import React from 'react';
import 'tailwindcss/tailwind.css';

const Home = () => {
  return (
    <div className="min-h-screen max-w-screen flex justify-center items-center bg-gradient-to-b from-gray-800 to-indigo-900 min-h-screen p-4 text-white text-center font-serif">
      <h1 className="text-4xl font-bold mb-8">Welcome to Hemant Mishra's Shop</h1>
      <p className="text-xl mt-20 animate-bounce">
        <img src="https://img.freepik.com/premium-vector/online-shopping-logo-wordmark-collection-set-design-vector-template_556845-189.jpg?size=626&ext=jpg&ga=GA1.1.2008654676.1689830924&semt=ais" alt="" />
      </p>
    </div>
  );
};

export default Home;
